import React from "react";

const Nav = () => {
  return (
    <div>
      <ul>
        <li>
          <a href="">Home</a>
        </li>
        <li>About</li>
        <li>Menu</li>
        <li>Reservations</li>
        <li>Order online</li>
        <li>Login</li>
      </ul>
    </div>
  );
};

export default Nav;
